import React, {Component} from 'react';

class Patient extends Component {
    constructor(props) {
        super(props);
        this.state = {
            year: 0,
            yearValid: false
        };
    }

    checkYear(e) {
        console.log(e.target.value);
        // Check year if it is correct
        let year = e.target.value;
        // Years between: 1900 - 2000
        let valid = false;

        // Write a condition to check the year 
        if(year >= 1900 && year <= 2000) {
            valid = true;
        }
    }

    render() {

       return <div>

        <input type="text" name="year" defaultValue={this.state.year} onChange={this.checkYear} />


       </div>; 

    }

}

export default Patient;
